  true,\n\t\"url\": null,\n\t\"notes\": \"<p>PHS Act section 2719 requires non-grandfathered
  group health plans and health insurance issuers offering non-grandfathered health
  insurance coverage to provide relevant notices in a culturally and linguistically
  appropriate manner.  The regulations implementing section 2719 require these plans
  and issuers to make certain accommodations for notices sent to an address in a county
  meeting a threshold percentage of people who are literate only in the same non-English
  language.<br />nThe list below includes all counties which meet or exceed the 10
  percent threshold for the 2006-2010 ACS data and is applicable for 2012.</p>n\",\n\t\"license_title\":
